    const changePage = (e, page) => {
        e.preventDefault();
        setPage(page);
    }
    return (
        <nav>
            <ul>
                <li>
                    <a href="/" onClick={changePage(e, "Home")}>Home</a>
                </li>
                <li>
                    <a href="/" onClick={changePage(event)}>About</a>
                </li>
            </ul>
        </nav>
    )
}

export default NavBar;
